htk_mgmt_action (){
   case $FULLAUTO in
      yes)
         local DELAY20=0
         local DELAY10=0
         ;;
      *)local DELAY20=20
        local DELAY10=10
        ;;
   esac
   local MACT=$1
   if [ $MACT = ins ];then
      if [ -x $MVL ];then
         echo "--------------------------------------------------"
         echo "$MVL APPEARS TO BE ALREADY INSTALLED"
         echo "--------------------------------------------------"
         echo "--------------------------------------------------------"
         echo "EXECUTE 'htk.sh --upg' TO RE-LINK, REINSTALL, or UPGRADE"
         echo "--------------------------------------------------------"
         echo Exiting ; exit
      fi
      local IWRD=INSTALL
   elif [ $MACT = upg ];then
      IWRD=UPGRADE
   fi
   echo "-------"
   echo "$IWRD"
   echo "-------"
   mkdir -p $IDIR $DOCDIR
   echo "----------------------------------------------"
   echo "EXECUTING $IWRD OF COMMAND LINKS IN $IDIR/"
   echo "----------------------------------------------"
   cp $ENAM $MVL 2>/dev/null
   chmod +x $MVL
   cd $IDIR
   for f in $(cat $MVL|grep -E "\<(h|n|s|x)\.[^ ]*\)" htk.sh|grep -v grep |tr -d ")") ; do
      cp -fl $MVL $f
   done
   echo "--------------------------------"
   echo "PURGING DEAD LINKS IN $IDIR/"
   echo "--------------------------------"
   for d in $(ls [mhnsx].*|xargs -i basename {});do
      grep "$d" $MVL >/dev/null || rm $d
   done
   echo "--------------"
   echo "SETTING UP SSH"
   echo "--------------"
   if [ ! -e ~/.ssh/id_${KEYTYPE} ] ; then
      mkdir -p ~/.ssh
      chown $USER ~/.ssh
      chmod 0700 ~/.ssh
      eval $KEYGENCMD
   fi
   if [ -d $LDIR/common -o -d $DOCDIR ];then
      echo "---------------------------------------------"
      echo "BACKING UP PRE-EXISTING HYPERF LIBS AND DOCS:"
      echo "---------------------------------------------"
      tar -zcf /var/lib/hyperf.$$.bak.tgz $MDIR/lib $DOCDIR 2>/dev/null
   fi
   read -t $DELAY10 -p "(Continues in 10 seconds or tap Enter)"
   cd /tmp
      echo
      echo "------------------------------------"
      echo "EXECUTING $IWRD OF HYPERF PAYLOAD:"
      echo "------------------------------------"
      yolk_2_stdout $MPLD $MVL| tar --no-overwrite-dir -zxf - -C / 2>/dev/null
      chown -R root.root $DOCDIR $MDIR 2>/dev/null
      echo
      echo
      echo "Would you like to $IWRD plush profile?"
      echo "Type $IWRD, if yes. [Def=no in 20 secs]"
      read -t $DELAY20 GOINST
      test -z $THSBL 2>/dev/null && THSBL=no
      if [ $GOINST = $IWRD ] 2>/dev/null;then
         echo "----------------------------------------"
         echo "EXECUTING $IWRD OF PLUSH PROFILE:"
         echo "----------------------------------------"
         # Perform backups only if there were original files...
         # ... **AND** no backups already sitting there
         mkdir -p $DHPRF
         if [ -e /etc/$PLUSH ] ; then
            cp -n /etc/$PLUSH $PBFL
         fi
         cp $BDIR/plush.profile /etc/$PLUSH
         sed -i "s@plush=[[:graph:]].*\>@plush=/etc/$PLUSH@g" /etc/$PLUSH
      else
         echo "In case you want to install it later,"
         echo "you can find plush in $BDIR"
      fi
   if [ ! -e ${DFCDIR}/hyperf.conf -o ! -e ${DFCDIR}/mui.conf -o $IWRD = UPGRADE ];then
      echo "---------------------------------------------"
      echo "EXECUTING $IWRD OF HYPERF FUNCTION LIBRARY:"
      echo "---------------------------------------------"
      mkdir -p $FDIR
      . $BDIR/plush.profile
      echo "#!/bin/bash"               > $FDIR/hyperf.fnc
      bgrep "^\#funcs" "^\#main" $MVL >> $FDIR/hyperf.fnc
   fi
   if [ ! -e $FDIR/plush.fnc -o ! -e $FDIR/plush_a2v -o $IWRD = UPGRADE ];then
      echo "-----------------------------------"
      echo "EXECUTING $IWRD OF PLUSH LIBRARIES:"
      echo "-----------------------------------"
      . $BDIR/plush.profile
      echo "#!/bin/bash"                                             > $FDIR/plush.fnc
      bgrep "^\#funcs" "^#changelog" $BDIR/plush.profile |head -n-1 >> $FDIR/plush.fnc
      plush_a2v_comments > $FDIR/plush_a2v
      plush_alias_2_vars >> $FDIR/plush_a2v
      chown root.root $FDIR/{hyperf,plush}.fnc $FDIR/plush_a2v
      chmod 444 $FDIR/{hyperf,plush}.fnc $FDIR/plush_a2v
   else
      yolk_2_stdout $MPLD $MVL > /tmp/payload.tgz
      echo "I found previously installed hyperf components,"
      echo "but the --UPGRADE option was not used."
      read -t 1
      echo "I do not want to overwrite the originals."
      read -t 1
      echo "I am Extracting payload.tgz to /tmp/ :"
      read -t 1
      echo "Manual extraction of the payload will be required,"
      echo "or you can re-run htk.sh with the --UPGRADE option"
      echo "--------------------------------------------------"
   fi
   echo "================================="
   echo "HYPERF FRAMEWORK $IWRD COMPLETE"
   echo "================================="
   case $FULLAUTO in
      yes)
         mkdir -p $DHPRF
         if [ -e /etc/$PLUSH ] ; then
            cp -n /etc/$PLUSH $PBFL.orig
         fi
         cp $BDIR/plush.profile /etc/$PLUSH
         bash $BDIR/cqt.sh
         bash $BDIR/grouper.sh
         ;;
   esac
}
make_source_from_htk (){
   local FP2TK=$(lspath $0)
   local HPSCD=hyperf_source_code
   if ! mkdir $HPSCD ; then
      echo Unable to make $HPSCD. Exiting...
      exit
   fi
   extract_source_items_and_set_sidir
   pushd $HPSCD &>/dev/null
   mkdir configs controller cqt grouper
   mv ${SIDIR}${MDIR}/lib/{freecans,demo_system} .
   local ESIZE=$(($(grep -n BEGIN_YOLK_${MPLD} $FP2TK | cut -d":" -f1)-2))
   head -${ESIZE} $FP2TK | sed 's/^# htk.sh--.*$/# htk.sh/g' > controller/hyperf.sh
   mv freecans/HYPERF.{BASHRC.sh,PROJECT.template,VIMDIFF.vim} configs
   mv freecans/HYPERF.{ENVIRONMENT.README,INPUTRC.sh,VIMRC.vim,} configs
   mv freecans/HYPERF.{dot.bashrc.sh,EXAMPLE.CYGWIN.BASHRC.sh,Session.vim} configs
   #
   #[x] EXAMPLE.CYGWIN.BASHRC.sh
   #[x] HYPERF.BASHRC.sh
   #[x] HYPERF.ENVIRONMENT.README
   #[x] HYPERF.INPUTRC.sh
   #[x] HYPERF.PROJECT.template
   #[ ] HYPERF.VIMDIFF.vim
   #[ ] HYPERF.VIMRC.vim
   #[ ] debug.vimrc
   #
   mv freecans/cqt.sh cqt
   mv freecans/grouper.sh grouper
   mv ${SIDIR}${MDIR}/lib/precans . 2>/dev/null
   mv ${SIDIR}${MDIR}/lib/funcs ./libs
   mv ${SIDIR}${DOCDIR} ./documentation
   mkdir jail_tools jic plush release sync license
   mv freecans/jail_tools*.tgz jail_tools
   mv freecans/jic.sh jic
   mv freecans/plush.profile plush
   ln -s freecans/htk_development_launcher_scriptlet ./.htk_development_launcher_scriptlet
   cp documentation/LICENSE license/hyperf.copyright.license
   safely_remove_extraction_directory $SIDIR
   popd &>/dev/null
   echo "                                              ------------------"
   echo "Source items should now be extracted here --> $(ls -d $HPSCD)"
   echo "                                              ------------------"
}
